create table havenbags_furnitures
(
    Id          int auto_increment
        primary key,
    HavenBagId  int               not null,
    FurnitureId int               not null,
    CellId      smallint unsigned not null,
    Orientation tinyint           not null
)
    engine = MyISAM
    charset = utf8;

create index Id
    on havenbags_furnitures (Id);

